import React from "react";
import UserStyled from "./UserStyled";

const User: React.FC = () => {
  return (
    <UserStyled>
      <section>
        <div className="div-form mt-4 d-flex justify-content-center align-items-center">
          <div className="d-flex flex-column align-items-center"></div>
        </div>
      </section>
    </UserStyled>
  );
};

export default User;
